import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

interface K8sGPTResult {
  Name: string;
  Namespace: string;
  Kind: string;
  Status: string;
  Details?: string;
  Error: { Text: string }[];
}

function App() {
  const [namespace, setNamespace] = useState('');
  const [results, setResults] = useState<K8sGPTResult[]>([]);
  const [loading, setLoading] = useState(false);
  const [analysisResult, setAnalysisResult] = useState<K8sGPTResult | null>(null);

  const fetchData = async () => {
    setLoading(true);
    try {
      const response = await axios.get<K8sGPTResult[]>(`http://localhost:8080/api/k8sgpt/analyze?namespace=${namespace}`);
      setResults(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
      setResults([]);
    }
    setLoading(false);
  };

  const analyzeIssue = async (resource: K8sGPTResult) => {
    setLoading(true);
    try {
      const response = await axios.post<K8sGPTResult>('http://localhost:8080/api/k8sgpt/analyze/details', {
        Name: resource.Name,
        Namespace: resource.Namespace,
        Kind: resource.Kind,
      });
      setAnalysisResult(response.data);
    } catch (error) {
      console.error('Error analyzing issue:', error);
      setAnalysisResult(null);
    }
    setLoading(false);
  };

  return (
    <div className="App p-4">
      <h1 className="text-2xl font-bold mb-4">Kubernetes Health Dashboard</h1>
      <div className="mb-4">
        <input
          type="text"
          placeholder="Enter Namespace"
          value={namespace}
          onChange={(e) => setNamespace(e.target.value)}
          className="border p-2 rounded mr-2"
        />
        <button
          onClick={fetchData}
          className="bg-blue-500 text-white px-4 py-2 rounded"
        >
          Fetch Resources
        </button>
      </div>
      {loading && <p>Loading...</p>}
      {!loading && results.length > 0 && (
        <table className="min-w-full border">
          <thead>
            <tr>
              <th className="border px-4 py-2">Name</th>
              <th className="border px-4 py-2">Namespace</th>
              <th className="border px-4 py-2">Kind</th>
              <th className="border px-4 py-2">Status</th>
              <th className="border px-4 py-2">Action</th>
            </tr>
          </thead>
          <tbody>
            {results.map((res, index) => (
              <tr key={index}>
                <td className="border px-4 py-2">{res.Name}</td>
                <td className="border px-4 py-2">{res.Namespace}</td>
                <td className="border px-4 py-2">{res.Kind}</td>
                <td className="border px-4 py-2">{res.Status}</td>
                <td className="border px-4 py-2">
                  {res.Status !== 'Healthy' && (
                    <button
                      onClick={() => analyzeIssue(res)}
                      className="bg-red-500 text-white px-2 py-1 rounded"
                    >
                      Analyze
                    </button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
      {analysisResult && (
        <div className="mt-6 p-4 border rounded shadow-md">
          <h2 className="text-xl font-semibold mb-2">Analysis Result</h2>
          <p><strong>Name:</strong> {analysisResult.Name}</p>
          <p><strong>Namespace:</strong> {analysisResult.Namespace}</p>
          <p><strong>Kind:</strong> {analysisResult.Kind}</p>
          <p><strong>Status:</strong> {analysisResult.Status}</p>
          {analysisResult.Details && (
            <p><strong>Details:</strong> {analysisResult.Details}</p>
          )}
          {(analysisResult.Error?.length ?? 0) > 0 && (
            <ul className="list-disc pl-5 mt-2">
              {analysisResult.Error.map((errItem: { Text: string }, i: number) => (
                <li key={i}>{errItem.Text}</li>
              ))}
            </ul>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
